import React from "react";
import Col from "react-bootstrap/Col";
import Card from "react-bootstrap/Card";

const AboutBoxes = () => {
    return (
        <Col md={4}>
            <Card.Text>
                <i class={`${props.icon}`}></i>
            </Card.Text>

            <Card.Title>
                <h2 class="fw-bold">{props.title}</h2>
            </Card.Title>
            <Card.Text>
                <p>{props.text}</p>
            </Card.Text>
        </Col>
    );
};

export default AboutBoxes;
